function Home() {
  const user = useAuthState(auth);
  const handleLogout = () => {
    signOut(auth);
  };
  return (
    <div className="app">
      <Sidebar handleLogout={handleLogout} user={user} />
      <Outlet/>
      <Widgets />
    </div>
  );
}

export default Home;
